    def combinationSum4(self, nums: List[int], target: int) -> int:
        f = {}
        for i in range(target + 1):
            f[i] = {}
            for x in nums:
                if i >= x:
                    f[i][x] = f.get(i - x, {}).get(x, 0) + (f[i - x].get(x, 0) if i - x in f[i - x] else 0)
        return f[target].get(0, 0)

        # Store intermediate results in a list to avoid too many dictionary lookups
        cache = {}
        for i in range(target + 1):
            cache[i] = {}
            for x in nums:
                if i >= x:
                    cache[i][x] = {}
                    for y in nums:
                        if i - x >= y:
                            cache[i][x][y] = cache.get(i - x, {}).get(y, 0) + (cache[i - x][y] if i - x in cache[i - x] and y in cache[i - x] else 0)
        return cache[target].get(0, {}).get(0, 0)

        # Use a 2D array to store the results of subproblems
        dp = [[0] * (len(nums) + 1) for _ in range(target + 1)]
        for i in range(target + 1):
            dp[i] = [0] * (len(nums) + 1)
            for j in range(len(nums)):
                dp[i][j] = 0
                if i >= nums[j]:
                    dp[i][j] = 1
                    for k in range(len(nums)):
                        if j != k and i >= nums[k]:
                            dp[i][j] += dp[i - nums[k]][k]
        return dp[target][-1]

        # Store the results of subproblems in a list of tuples
        cache = []
        for i in range(target + 1):
            cache.append([])
            for x in nums:
                if i >= x:
                    cache[i].append(0)
                    for y in nums:
                        if i - x >= y:
                            cache[i][x] += (cache[i - x][y] if cache[i - x] and y < len(cache[i - x]) else 0)
        return cache[target][-1]
